import React, { useState } from 'react';
import './AddAnimal.css';

function AddAnimal() {
  // State variables to store user inputs
  const [name, setName] = useState('');
  const [species, setSpecies] = useState('');
  const [gender, setGender] = useState('');
  const [dob, setDob] = useState('');
  const [endangered, setEndangered] = useState('');
  const [origin, setOrigin] = useState('');
  const [lifeStage, setLifeStage] = useState('');

  // Function to handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();

    // Log the values entered by the user
    console.log('Animal Name:', name);
    console.log('Animal Species:', species);
    console.log('Animal Gender:', gender);
    console.log('Animal Date of Birth:', dob);
    console.log('Is Animal Endangered?:', endangered);
    console.log('Animal Origin:', origin);
    console.log('Animal Life Stage:', lifeStage);

    // Reset form fields after submission
    setName('');
    setSpecies('');
    setGender('');
    setDob('');
    setEndangered('');
    setOrigin('');
    setLifeStage('');

    // Implement backend logic here to send the data inputs to the backend
    // This can be done using fetch or any other method to send data to your server
  };

  return (
    <div className="add-animal-container">
      <h2>Add Animal</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name">Animal Name:</label>
          <input
            type="text"
            id="name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="species">Animal Species:</label>
          <input
            type="text"
            id="species"
            value={species}
            onChange={(e) => setSpecies(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="gender">Animal Gender:</label>
          <input
            type="text"
            id="gender"
            value={gender}
            onChange={(e) => setGender(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="dob">Animal Date of Birth:</label>
          <input
            type="date"
            id="dob"
            value={dob}
            onChange={(e) => setDob(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="endangered">Is Animal Endangered? (yes/no):</label>
          <input
            type="text"
            id="endangered"
            value={endangered}
            onChange={(e) => setEndangered(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="origin">Animal Origin:</label>
          <input
            type="text"
            id="origin"
            value={origin}
            onChange={(e) => setOrigin(e.target.value)}
            required
          />
        </div>
        <div className="form-group">
          <label htmlFor="lifeStage">Animal Life Stage:</label>
          <input
            type="text"
            id="lifeStage"
            value={lifeStage}
            onChange={(e) => setLifeStage(e.target.value)}
            required
          />
        </div>
        <button type="submit">Add Animal</button>
      </form>
    </div>
  );
}

export default AddAnimal;
